import logo from './logo.svg';
import './App.css';
import requestHandler from './helpers/requestHandler';

const testUR = 'https://api.edamam.com/search?app_id=900da95e&app_key=40698503668e0bb3897581f4766d77f9&q=coffee'
const testOptions = {q: "coffee"}

function App() {
  return (
    <div className="App">
      {requestHandler(testURL, testOptions)}
    </div>
  );
}

export default App;
